// src/components/Projects/Projects.jsx
import React from "react";

// Small pill for tech stack
const Badge = ({ children }) => (
  <span className="inline-block rounded-md border border-green-500 bg-black px-2.5 py-1 text-xs text-green-400">
    {children}
  </span>
);

const projects = [
  {
    title: "LADy — Latent Aspect Detection",
    summary:
      "Research framework for ABSA: dataset integration (SemEval, Google Local, Yelp), deep-learning model experiments, and benchmarking.",
    tech: ["Python", "PyTorch", "NLTK", "Transformers"],
  },
  {
    title: "Diabetes Prediction",
    summary:
      "Early diabetes risk prediction using ML models (Logistic Regression, Random Forest, SVM). Compared accuracy, precision, and recall.",
    tech: ["Python", "scikit-learn", "Pandas", "NumPy"],
  },
  {
    title: "Portfolio Website",
    summary:
      "Responsive React + Tailwind portfolio with smooth scrolling, animated sections, and project showcase.",
    tech: ["React", "TailwindCSS", "JavaScript"],
  },
];

const Projects = () => {
  return (
    <section className="bg-black py-12 text-green-400">
      <h2 className="mb-8 text-center text-3xl font-bold text-green-500">
        Projects
      </h2>
      <div className="mx-auto grid max-w-4xl gap-6 px-4 sm:grid-cols-2">
        {projects.map((project, idx) => (
          <div
            key={idx}
            className="rounded-2xl border border-green-500 bg-black p-6 shadow-lg hover:shadow-green-600/50 transition"
          >
            <h3 className="text-xl font-semibold text-green-400">
              {project.title}
            </h3>
            <p className="mt-2 text-sm text-green-300">{project.summary}</p>
            <div className="mt-4 flex flex-wrap gap-2">
              {project.tech.map((t, i) => (
                <Badge key={i}>{t}</Badge>
              ))}
            </div>
          </div>
        ))}
      </div>
    </section>
  );
};

export default Projects;
